export default {
  name: "ResponseCard",
  props: {
    responseArray: [],
    title: String
  },
  computed: {
    responseString: function responseString() {
      var returnString = '';

      for (var i = 0; i < this.responseArray.length; i++) {
        var myResponse = this.responseArray[i];
        returnString += myResponse + '\n';
      }

      return returnString;
    }
  }
};
